import logo from "./logo.svg";
import "./App.css";

// ima
import { SignUp } from "./signUp/SignUp";
// imr
import React from "react";
// imrse
import { useState, useEffect } from "react";

function Header() {
  return (
    <div className="Header">
      <a className="logo">
        <div className="logo__img">
          <img src="#"></img>
        </div>
        <div className="logo__text">todo</div>
      </a>

      <a className="signIn_link button" src="#">sign in</a>
      <a className="signUp_link button btn__border" src="#">sign up</a>
    </div>
  );
}
export default function App() {
  return (
    <div className="App" style="background-image: url(">
      <Header/>
    </div>
  );
}
